float ToNumber2(const string& text)
{
	float result= (float) stof(text.c_str());
	return result;
};



void FileReading2(char* file,vector<vector<float>>* array_2D ,int n_row,int n_cloumn)
{
	(*array_2D).resize(n_row);
	long count_row=0,count_cloumn=0;
	ifstream fin(file);  
	string s; 
	float tmp;
	vector <float> row;

	unsigned i,j;
	for(i=0; i!=n_row; ++i) (*array_2D)[i].resize(n_cloumn);

	while( !fin.eof() )
	{    
		getline(fin,s,' ');
		(*array_2D)[count_row][count_cloumn]=ToNumber2(s);
		count_cloumn++;
		
		if (count_cloumn>=n_cloumn)
		{
			count_cloumn=0;
			count_row++;
		}
	}

}